import React, { useState, useEffect, useCallback } from 'react';
import './BookingsPage.css';
import logo from './logo.png';
import BookingDetailsModal from './BookingDetailsModal';

function BookingsPage() {
  const [selectedBooking, setSelectedBooking] = useState(null);
  const [sortOption, setSortOption] = useState('date');
  const [searchQuery, setSearchQuery] = useState('');
  const [filterOption, setFilterOption] = useState('');
  const [bookings, setBookings] = useState([]);
  const [loading, setLoading] = useState(true);
  const [error, setError] = useState(null);
  const [currentPage, setCurrentPage] = useState(1);
  const bookingsPerPage = 6;

  useEffect(() => {
    const fetchBookings = async () => {
      try {
        // Simulate a fetch request
        setTimeout(() => {
          setBookings([
            // Your mock bookings data
          ]);
          setLoading(false);
        }, 1000);
      } catch (err) {
        setError('Failed to load bookings.');
        setLoading(false);
      }
    };

    fetchBookings();
  }, []);

  const sortedBookings = useCallback(() => {
    return bookings.sort((a, b) => {
      if (sortOption === 'price') {
        return parseFloat(a.price.replace('$', '')) - parseFloat(b.price.replace('$', ''));
      } else if (sortOption === 'date') {
        return new Date(a.checkIn) - new Date(b.checkIn);
      } else if (sortOption === 'guests') {
        return a.guests - b.guests;
      } else if (sortOption === 'hotelName') {
        return a.hotelName.localeCompare(b.hotelName);
      }
      return 0;
    });
  }, [bookings, sortOption]);

  const filteredBookings = useCallback(() => {
    return sortedBookings().filter(booking =>
      booking.hotelName.toLowerCase().includes(searchQuery.toLowerCase()) &&
      (filterOption === '' || parseFloat(booking.price.replace('$', '')) <= parseFloat(filterOption))
    );
  }, [sortedBookings, searchQuery, filterOption]);

  const indexOfLastBooking = currentPage * bookingsPerPage;
  const indexOfFirstBooking = indexOfLastBooking - bookingsPerPage;
  const currentBookings = filteredBookings().slice(indexOfFirstBooking, indexOfLastBooking);

  const handleSearchChange = (event) => setSearchQuery(event.target.value);
  const handleFilterChange = (event) => setFilterOption(event.target.value);
  const handleSortChange = (event) => setSortOption(event.target.value);
  const handleViewDetails = (booking) => setSelectedBooking(booking);
  const handleCloseModal = () => setSelectedBooking(null);
  const handleCancelBooking = (id) => setBookings(bookings.filter(booking => booking.id !== id));
  const handleClearFilters = () => {
    setSearchQuery('');
    setFilterOption('');
    setSortOption('date');
  };
  const handlePageChange = (pageNumber) => setCurrentPage(pageNumber);

  if (loading) {
    return <div className="loading">Loading...</div>;
  }

  if (error) {
    return <div className="error">{error}</div>;
  }

  return (
    <div className="bookings-page">
      <div className="logo-container">
        <img src={logo} alt="Hotel Reservations App" className="home-logo" />
      </div>

      <h1 className='h1booking'>Your Bookings</h1>

      <div className="filters">
        <input
          type="text"
          placeholder="Search by hotel name"
          value={searchQuery}
          onChange={handleSearchChange}
          className="search-input"
        />
        <select value={filterOption} onChange={handleFilterChange} className="filter-select">
          <option value="">No Filter</option>
          <option value="1000">Under $1000</option>
          <option value="1500">Under $1500</option>
          <option value="2000">Under $2000</option>
        </select>
        <select value={sortOption} onChange={handleSortChange} className="sort-select">
          <option value="date">Sort by Date</option>
          <option value="price">Sort by Price</option>
          <option value="guests">Sort by Guests</option>
          <option value="hotelName">Sort by Hotel Name</option>
        </select>
        <button onClick={handleClearFilters} className="clear-filters">Clear Filters</button>
      </div>

      <div className="bookings-list">
        {currentBookings.length > 0 ? (
          currentBookings.map((booking) => (
            <div className="booking-item" key={booking.id}>
              <img src={booking.image} alt={booking.hotelName} className="booking-image" />
              <div className="booking-details">
                <h2>{booking.hotelName}</h2>
                <p><strong>Check-In:</strong> {booking.checkIn}</p>
                <p><strong>Check-Out:</strong> {booking.checkOut}</p>
                <p><strong>Guests:</strong> {booking.guests}</p>
                <p><strong>Price:</strong> {booking.price}</p>
                <p><strong>Booking ID:</strong> {booking.bookingId}</p>
                <p><strong>Contact Number:</strong> {booking.contactNumber}</p>
              </div>
              <div className="booking-actions">
                <button className="view-button" onClick={() => handleViewDetails(booking)}>View Details</button>
                <button className="cancel-button" onClick={() => handleCancelBooking(booking.id)}>Cancel Booking</button>
              </div>
            </div>
          ))
        ) : (
          <p>No bookings found.</p>
        )}
        {selectedBooking && (
          <BookingDetailsModal booking={selectedBooking} onClose={handleCloseModal} />
        )}
      </div>

      <div className="pagination">
        <button
          className="prev-page"
          onClick={() => handlePageChange(1)}
          disabled={currentPage === 1}
          aria-label="First Page"
        >
          &laquo;&laquo;
        </button>
        <button
          className="prev-page"
          onClick={() => handlePageChange(currentPage - 1)}
          disabled={currentPage === 1}
          aria-label="Previous Page"
        >
          &laquo;
        </button>
        {[...Array(Math.ceil(filteredBookings().length / bookingsPerPage)).keys()].map((pageNumber) => (
          <button
            key={pageNumber + 1}
            className={`page-number ${pageNumber + 1 === currentPage ? 'active' : ''}`}
            onClick={() => handlePageChange(pageNumber + 1)}
            aria-label={`Page ${pageNumber + 1}`}
          >
            {pageNumber + 1}
          </button>
        ))}
        <button
          className="next-page"
          onClick={() => handlePageChange(currentPage + 1)}
          disabled={currentPage === Math.ceil(filteredBookings().length / bookingsPerPage)}
          aria-label="Next Page"
        >
          &raquo;
        </button>
        <button
          className="next-page"
          onClick={() => handlePageChange(Math.ceil(filteredBookings().length / bookingsPerPage))}
          disabled={currentPage === Math.ceil(filteredBookings().length / bookingsPerPage)}
          aria-label="Last Page"
        >
          &raquo;&raquo;
        </button>
      </div>
    </div>
  );
}

export default BookingsPage;
